import React from "react";
import { useRoutes } from "react-router";

// Pages
import Home from "./pages/home";
import Login from "./pages/login";

function App() {
  const routes = useRoutes([
    { path: '/', element: <Home /> },
    { path: '/Login', element: <Login /> },
  ])
  return routes;
}

export default App;
